import { NavLink } from 'react-router-dom';


const Profile = async () => {


  const getProfile = async () => {
    const res = fetch('/profile', {
      method: 'GET',
      headers: {
        "Content-type": 'application/json',
        Accept: 'application/json'
      },
      credentials: 'include'

    })

    const data = await res.json()
    console.log(data)
  }

